    "["Access Constraints: Access is restricted to personnel authorized in accordance
    with NOAA Administrative Order 216-100. A signed non-disclosure agreement must be
    on file for all authorized personnel.  The APSD Data Request staff are the POC for
    non-disclosure forms. | Use Constraints: Access to individual reports is restricted
    to NOAA employees and our partners who have signed non-disclosure agreements.  Summary
    data may be made available based on the "rule of 3", i.e., there must be at least
    three entities included in a summary for the summary information to be made publically
    available.  Data may be made available if there is no information included that
    could uniquely link the information to an individual entity (person, vessel operating
    unit, business, etc.).  Individually identifiable information may not be released
    without written authorization from the provider or by court order."]"nt},nt{ntt"key":
